    true,nt"url": null,nt"notes": "U.S. Geological Survey, Department of the
    Interior - The annual Geographic Names acquisition plan is to collect geographic
    name data over the United States and its territories through the Board on Geographic
    Names processes. The U.S. Board on Geographic Names is a Federal body created in
    1890 and established in its present form by Public Law in 1947 to maintain uniform
    geographic name usage throughout the Federal Government. The Board comprises representatives
    of Federal agencies concerned with geographic information, population, ecology,
    and management of public lands. Sharing its responsibilities with the Secretary
    of the Interior, the Board promulgates official geographic feature names with locative
    attributes as well as principles, policies, and procedures governing the use of
    domestic names, foreign names, Antarctic names, and undersea feature names. The
    Geographic Names Information System (GNIS), developed by the U.S. Geological Survey
    (USGS) in cooperation with the U.S. Board on Geographic Names (BGN), contains information
    about the official names for places, features, and areas in the 50 States, the District
    of Columbia, the territories and outlying areas of the United States, including
    Antarctica.The Board of Geographic Names maintains working relationships with State
    names authorities to cooperate in achieving the standardization of geographic names.
    GNIS is the geographic names component of The National Map. Interested parties who
    wish to become a data acquisition partner with the USGS in FY17 or in future years
    should contact a USGS Geospatial Liaison - http://liaisons.usgs.gov/geospatial/documents/TNM_Partnership_User_ContactList.pdf.",nt"license_title":
